			if (UniqueItemStats[gbid].WeaponDamageMax.Count == 1 || UniqueItemStats[gbid].WeaponDamageMax.First() == UniqueItemStats[gbid].WeaponDamageMax.Last()) return UniqueItemStats[gbid].WeaponDamageMax.First();
